The '''Inland Sea''' was the name of a large sea in the [[Great Lands]], later known as the [[wikipedia:Mediterranean|Mediterranean]], according to the early version of the [[legendarium]] in ''[[The Book of Lost Tales]]''.<ref name="Med">{{LT2|VI}}, pp. 294-5</ref>

== Other names ==
The sea was also called '''''Wendelsæ''''' in [[Old English]].<ref name="Med"/>

